import React from 'react';
import './LoginPage.css'
import Grid from '@material-ui/core/Grid';
import insta_image from '../../images/9364675fb26a.svg';
import insta_logo from '../../images/logoinsta.png';

function LoginPage() {
  return (
    <div>
        <Grid container>
            <Grid item xs={3}>aaa</Grid>
            <Grid item xs={6}>
                <div className={"loginPage_main"}>
                    <div>
                        <img src={insta_image} width={"454px"} alt="인스타그램사진" />
                    </div>
                    <div>
                        <div className={"loginpage_rightcomponent"}>
                            <img src={insta_logo} className={"loginPage_logo"} alt=""/>
                            <div className={"loginPage_signin"}>
                                <input className={"loginPage_text"} type="text" placeholder="Phone number, username, or email"/>
                                <input className={"loginPage_text"} type="password"/>
                                <button className={"login_button"}>Sign In</button>
                            </div>
                        </div>
                    </div>
                </div>
            </Grid>
            <Grid item xs={3}>ccc</Grid>
        </Grid>
        Hello World!
    </div>
  );
};

export default LoginPage;
